(->>
  '[[clojurewerkz/statistiker "0.1.0-SNAPSHOT"]
	[com.github.haifengl/smile-core "1.5.2"]
	[rhizome "0.2.9"]
	[uncomplicate/fluokitten "0.9.0"]
	[com.rpl/specter "1.1.2"]
	[net.mikera/core.matrix "0.62.0"]]
  (map alembic.still/distill)
  doall)

