;; **
;;; To use our data with the Smile Java library, we need to translate clojure vectors into java arrays.
;;; 
;;; Let us transform our datasets accordingly.
;; **

;; @@
(def x-java-datasets
  (->> x-datasets
       (fmap (fn [data]
               (->> data
                    (map double-array)
                    into-array)))))

(def y-java-datasets
  (->> y-datasets
       (fmap (fn [data]
               (->> data
                    double-array)))))

;; @@
