ight 247.2188, :padding {:top 10, :left 55, :bottom 40, :right 10}, :data [{:name \"369412c7-c8af-43c4-9218-238a527c1263\", :values ({:x -0.8523615115550425, :y 0} {:x -0.5218067439268772, :y 19.0} {:x -0.191251976298712, :y 42.0} {:x 0.13930279132945322, :y 65.0} {:x 0.46985755895761844, :y 63.0} {:x 0.8004123265857837, :y 24.0} {:x 1.130967094213949, :y 2.0} {:x 1.4615218618421142, :y 0.0} {:x 1.7920766294702795, :y 1.0} {:x 2.1226313970984445, :y 2.0} {:x 2.4531861647266098, :y 0})}], :marks [{:type \"line\", :from {:data \"369412c7-c8af-43c4-9218-238a527c1263\"}, :properties {:enter {:x {:scale \"x\", :field \"data.x\"}, :y {:scale \"y\", :field \"data.y\"}, :interpolate {:value \"step-before\"}, :fill {:value \"steelblue\"}, :fillOpacity {:value 0.4}, :stroke {:value \"steelblue\"}, :strokeWidth {:value 2}, :strokeOpacity {:value 1}}}}], :scales [{:name \"x\", :type \"linear\", :range \"width\", :zero false, :domain {:data \"369412c7-c8af-43c4-9218-238a527c1263\", :field \"data.x\"}} {:name \"y\", :type \"linear\", :range \"height\", :nice true, :zero false, :domain {:data \"369412c7-c8af-43c4-9218-238a527c1263\", :field \"data.y\"}}], :axes [{:type \"x\", :scale \"x\", :title \"error\", :titleOffset 30} {:type \"y\", :scale \"y\"}]}}, :median-absolute-error 0.2935149729391843, :mean-square-error 0.18911771}, :opts nil}"}
;; <=

;; **
;;; Now, let us generalize this, to compare several models.
;;; 
;;; First, let us write a general function to train a model. The model may be one of the following:
;;; - a regression tree (constructed with [this](https://haifengl.github.io/smile/api/java/smile/regression/RegressionTree.html#RegressionTree-double:A:A-double:A-int-int-) constructor)
;;; - a regression random forest (constructed with [this](https://haifengl.github.io/smile/api/java/smile/regression/RandomForest.html#RandomForest-double:A:A-double:A-int-int-int-int-) constructor)
;;; 
;;; We define a general `train` function, that takes the relevant parameters as a map, using [destructuring](https://clojure.org/guides/destructuring), and returns the trained model.
;;; 
;; **

;; @@
(defn train [{:keys [;; model type -- either :tree or :forest
                     model-type 
                     ;; parameters relevant for both tree and forest:
                     max-nodes
                     node-size 
                     ;; parameters relevant only for forest
                     n-trees
                     mtry]}]
  (case model-type
    :tree 	(RegressionTree. (:train x-java-datasets)
                	         (:train y-java-datasets)
            	             max-nodes
                    	     node-size)
    :forest (RandomForest.	 (:train x-java-datasets)
                	         (:train y-java-datasets)
                             n-trees
                             max-nodes
                    	     node-size
                             mtry)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.machine-learning/train</span>","value":"#'examples.machine-learning/train"}
;; <=

;; **
;;; Let us try it:
;; **

;; @@
(train {:model-type :forest
        :max-nodes 20
        :node-size 10
        :n-trees 1000
        :mtry 3})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#object[smile.regression.RandomForest 0x6a9ba466 &quot;smile.regression.RandomForest@6a9ba466&quot;]</span>","value":"#object[smile.regression.RandomForest 0x6a9ba466 \"smile.regression.RandomForest@6a9ba466\"]"}
;; <=

;; **
;;; So, we asked it to create a trained regression random forest, and it seems to have created one.
;;; 
;;; Now, let us create a function for training a model and testing its performance - both over the training and the test sets.
;; **

;; @@
(defn train-and-test [training-parameters]
  (let [model (train training-parameters)]
    {:training-parameters training-parameters
     :model model
     :results 
      (for [dataset-type [:train :test]]
        (let [prediction (.predict model (dataset-type x-java-datasets))
     		  reality 	 (dataset-type y-java-datasets)
      		  error 	 (map - prediction reality)
              color		 (case dataset-type
                          :train "magenta"
                          :test	 "blue")]
         {:dataset-type				dataset-type
          :scatter-plot 			(plot/list-plot (map vector prediction reality)
                                		  	:x-title "prediction"
                                  			:y-title "reality"
                                            :plot-range [[0 5] [0 5]]
                                            :color color)
  		  :error-histogram 			(plot/histogram error
                            	         	:x-title "error"
                                            :plot-range [[-3 3] :all]
                                            :bins 100
                                            :color color)
    	  :median-absolute-error 	(-> error mat/abs stat/median)
    	  :mean-square-error 		(-> error mat/square stat/mean)}))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.machine-learning/train-and-test</span>","value":"#'examples.machine-learning/train-and-test"}
;; <=

;; **
;;; Let us try it:
;; **

;; @@
(defn view-model-results [model-results]
  (-> model-results
      (dissoc :model)
      (update :training-parameters (comp table/table-view vector))
      (update :results table/table-view)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.machine-learning/view-model-results</span>","value":"#'examples.machine-learning/view-model-results"}
;; <=

;; @@
(-> {:model-type :tree
     :max-nodes 50
     :node-size 2}
    train-and-test
    view-model-results)
