(defn svg->gorilla [svg]
  (reify render/Renderable
    (render [self]
      {:type    :html
       :content svg
       :value   (pr-str self)})))

(defn view-tree [tree]
  (-> tree
      (.dot)
      rhizome.viz/dot->svg
  	  svg->gorilla))
